import ExhibitAdd from './components/adminUpd'

function App() {
  return (
    <Router>
      <div>
        <Route path="/" exact component={ExhibitAdd} />
        <Route path="/learningStyles" exact component={ExhibitAdd}/>
        <Route path="/map" exact component={ExhibitAdd}/>

      </div>
    </Router>

  );
}

export default App;
